esolution of issues.\n	Conduct technical research and experiment in specific testing area.</p>\n<p><em></em>\n	Bachelor degree in Computer Science, Engineering or equivalent.\n	1~5 years experience in IT SW testing, integration and verification work.\n	Knowledge of testing principles and methodology, understand SW development process and how to guarantee SW quality.\n	Knowledge and experience with test automation tools like SOAP UI/Jmeter and programming like Java/Python/Perl/Ruby is one plus.\n	Knowledge of data analytics, database management is one plus.\n	Proactive, self-motivated, target driven and innovative thinking are preferred.\n	Ability to pay close attention to details, and at the same time, to see the big picture.\n	Strong analytical skills, active to analyze complex problems and work out adequate solutions.\n	Good communication skills, strong verbal and written communication skills in English.\n	Team oriented individual.</p>\n</div>','5b1cd15b8a4f51e140d946e8','5b1ccfec57137f22415c4aed',NULL,'2018-07-10 05:14:30'),('5b44678d13ca2fe569fb9270','<div class=\"markdown-text\"><p><a href=\"/user/yuu2lee4\">@yuu2lee4</a> phpphp</p>\n<p>nodejsnodejsphpjs</p>\n<p>  php  java  python  nodejs</p>\n<p>nodejsnodejs </p>\n</div>','5b3748c457137f22415c5143','5b37469f57137f22415c5140','5b4435ca13ca2fe569fb925e','2018-07-10 08:00:14'),('5b44e038e374eeab6929d5c4','<div class=\"markdown-text\"><p>11</p>\n</div>','592f8ef01e7e75f60c1ad80d','bxxUvsTgn4tFJjYJhEEJsJsF',NULL,'2018-07-10 16:35:05'),('5b45bc8b35342ab069061451','<div class=\"markdown-text\"><p><a href=\"/user/koa666\">@koa666</a> node</p>\n</div>','5b3748c457137f22415c5143','HPb8hfPKfkt2KdLruWm48e8e','5b44678d13ca2fe569fb9270','2018-07-11 08:15:08'),('5b46113efb9e84ec69cc19d2','<div class=\"markdown-text\"><p></p>\n</div>','5b18a28557137f22415c49e9','96BXv5xu22Z8xDqyzMo5g5HE',NULL,'2018-07-11 14:16:30'),('5b4805b235342ab0690614de','<div class=\"markdown-text\"><p></p>\n</div>','5b1cd15b8a4f51e140d946e8','5b1ccfec