INSERT INTO `topic` VALUES ('51fc8bd944e76d216ab64939','Node.js  (gm)','<div class=\"markdown-text\"><p><a href=\"http://blog.csdn.net/kidx_/article/details/9709387\">http://blog.csdn.net/kidx_/article/details/9709387</a></p>\n<p>GM : GraphicsMagick for node.js\n GraphicsMagick  ImageMagick\n\n$ sudo npm install gm</p>\n<p>ImageMagickubuntu\n$ sudo apt-get install imagemagick</p>\n<p>HOW TO USE\nGM <a href=\"http://aheckmann.github.io/gm/docs.html\">http://aheckmann.github.io/gm/docs.html</a>\nImageMagick\nvar imageMagick = gm.subClass({ imageMagick: true });\ngmImageMagick\nimageMagick(img.png).resize(300, 100).autoOrient().write(/path, callback);</p>\n<p>Example (nodejs + Express)</p>\n<pre class=\"prettyprint\"><code>var gm = require(&#x27;gm&#x27;)\n,  fs = require(&#x27;fs&#x27;)\n,	imageMagick = gm.subClass({ imageMagick : true });\nexports.imgUpload = function(req, res) {\n	res.header(&#x27;Content-Type&#x27;, &#x27;text&#x2F;plain&#x27;);\n  var path = req.files.img.path;	&#x2F;&#x2F;\n  var sz = req.files.img.size;\n  if (sz &gt; 2*1024*1024) {\n    fs.unlink(path, function() {	&#x2F;&#x2F;fs.unlink \n      res.end(&#x27;1&#x27;);\n    });\n  } else if (req.files.img.type.split(&#x27;&#x2F;&#x27;)[0] != &#x27;image&#x27;) {\n    fs.unlink(path, function() {\n      res.end(&#x27;2&#x27;);\n    });\n  } else {\n    imageMagick(path)\n    .resize(150, 150, &#x27;!&#x27;) &#x2F;&#x2F;(&#x27;!&#x27;)150*150\n    .autoOrient()\n    .write(&#x27;public&#x2F;images&#x2F;user&#x2F;&#x27;+req.files.img.name, function(err){\n      if (err) {\n        console.log(err);\n        res.end();\n      }\n      fs.unlink(path, function() {\n        return res.end(&#x27;3&#x27;);\n      });\n    });\n  }\n};\n</code></pre><p>index.js\n<a href=\"http://pan.baidu.com/share/link?shareid=2913111267&amp;uk=2552401515\">Example</a></p>\n<p>\n<img src=\"http://img.blog.csdn.net/20130802161424593?watermark/2/text/aHR0cDovL2Jsb2cuY3Nkbi5uZXQva2lkeF8=/font/5a6L5L2T/fontsize/400/fill/I0JBQkFCMA==/dissolve/70/gravity/Center\" alt=\"alt example\"></p>\n<p> public/images/user/ </p>\n<p>\ngm(img.png).crop(width, height, x, y)</p>\n<p>gmhttp://aheckmann.github.io/gm/docs.html</p>\n</div>','50ab99f8637ffa41554d1fa9',0,1,55,70691,'2013-08-03 04:49:29','2019-01-09 20:53:18','2018-11-09 06:33:12','share'),('5231a630101e574521e45ef8','exports  module.exports ','<div class=\"markdown-text\"><p>require  exports  module.exports  exports  module.exports  exports  module.exports  js </p>\n<p><strong>test.js</strong></p>\n<p>var a = {name: 1};\nvar b = a;</p>\n<p>console.log(a);\nconsole.log(b);</p>\n<p><a href=\"http://b.name\">b.name</a> = 2;\nconsole.log(a);\nconsole.log(b);</p>\n<p>var b = {name: 3};\nconsole.log(a);\nconsole.log(b);</p>\n<p> test.js </p>\n<p>{ name: 1 }\n{ name: 1 }\n{ name: 2 }\n{ name: 2 }\n{ name: 2 }\n{ name: 3 }</p>\n<p><strong></strong>a b  a  a  b  b  a  b  a  b b a </p>\n<p> exports  module.exports </p>\n<ol>\n<li>module.exports  {}</li>\n<li>exports  module.exports </li>\n<li>require()  module.exports  exports</li>\n</ol>\n<p> Node.js :\n<img src=\"//static.cnodejs.org/FjN9jHWiy-yuUtghTUlRgB_0cgUC\" alt=\" 2016-09-29 11.59.44.png\">\n</p>\n<pre class=\"prettyprint\"><code>exports = module.exports = somethings\n</code></pre><p>:</p>\n<pre class=\"prettyprint\"><code>module.exports = somethings\nexports = module.exports\n</code></pre><p> module.exports exports  module.exports  exports = module.exports  exports  module.exports </p>\n</div>','5110f2bedf9e9fcc584e4677',0,1,109,271243,'2013-09-12 11:32:01','2019-01-09 20:53:18','2018-11-09 11:15:39','share'),('541ed2d05e28155f24676a12','','<div class=\"markdown-text\"><p>, , \n Node.js , \n, :</p>\n<ul>\n<li>, , </li>\n<li>, </li>\n<li>,  GitHub </li>\n<li>, </li>\n<li></li>\n<li></li>\n</ul>\n<p> Ruby China , :\n<a href=\"https://ruby-china.org/jobs\">https://ruby-china.org/jobs</a>\n,  Markdown (<code>##</code> )\n, :</p>\n<blockquote>\n<p> [] +, &quot;[] XXXX  Node.js  3 \n\n\n\n\n</p>\n</blockquote>\n<p> cnodejs , :\n<a href=\"http://weibo.com/p/1005051958172255/\">http://weibo.com/p/1005051958172255/</a>\n, , \n, .</p>\n</div>','4efc278525fa69ac69000141',0,1,18,9259,'2014-09-21 13:29:52','2019-01-09 20:53:18','2018-11-22 03:05:42','job'),('545de1e1a68535a174fe51b5','request ','<div class=\"markdown-text\"><p></p>\n<p><a href=\"http://zhuanlan.zhihu.com/api/columns/bigertech/posts/19885746\">http://zhuanlan.zhihu.com/api/columns/bigertech/posts/19885746</a></p>\n<p> <code>request</code> \n \n</p>\n<pre class=\"prettyprint\"><code>var request = require(&#x27;request&#x27;);\nrequest(&#x27;http:&#x2F;&#x2F;zhuanlan.zhihu.com&#x2F;api&#x2F;columns&#x2F;bigertech&#x2F;posts&#x2F;19885746&#x27;, function (req,res,body) {\n    console.log(body);\n});\n</code></pre></div>','52c61c248a716e0b1526d7d2',0,1,35,32151,'2014-11-08 09:26:57','2019-01-09 20:53:18','2018-11-16 08:40:01','ask'),('55755426c4e7fbea6e9a30c8','node-shared-cache: cluster','<div class=\"markdown-text\"><p></p>\n<ul>\n<li>session</li>\n<li></li>\n<li>oauth<code>access_token</code></li>\n</ul>\n<p>memcached/redis<code>node-shared-cache</code>(<a href=\"https://github.com/kyriosli/node-shared-cache\"></a>)<code>node-shared-cache</code></p>\n<ul>\n<li></li>\n<li>APIjs</li>\n<li>js300w</li>\n<li></li>\n</ul>\n<h2></h2>\n<pre class=\"prettyprint\"><code>var cache = require(&#x27;node-shared-cache&#x27;);\nvar obj = new cache.Cache(&quot;test&quot;, 557056);\n&#x2F;&#x2F; setting property\nobj.foo = &quot;bar&quot;;\n&#x2F;&#x2F; getting property\nconsole.log(obj.foo);\n&#x2F;&#x2F; enumerating properties\nfor(var k in obj);\nObject.keys(obj);\n&#x2F;&#x2F; deleting property\ndelete obj.foo;\n&#x2F;&#x2F; writing objects is also supported\nobj.foo = {&#x27;foo&#x27;: &#x27;bar&#x27;};\n&#x2F;&#x2F; but original object reference is not saved\nvar test = obj.foo = {&#x27;foo&#x27;: &#x27;bar&#x27;};\ntest === obj.foo; &#x2F;&#x2F; false\n&#x2F;&#x2F; circular reference is supported.\ntest.self = test;\nobj.foo = test;\n&#x2F;&#x2F; and saved result is also circular\ntest = obj.foo;\ntest.self === test; &#x2F;&#x2F; true\n</code></pre><h2></h2>\n<h3></h3>\n<p>socket</p>\n<h3>hashmap</h3>\n<p>hashmap</p>\n<h3>LRU</h3>\n<p>LRUcache</p>\n<h3>futex</h3>\n<p>futex</p>\n<h3>binary json</h3>\n<p>js/</p>\n</div>','5538a74691bdb6e41239d3a3',0,1,16,7613,'2015-06-08 08:36:54','2019-01-09 20:53:18','2018-11-28 03:06:46','share'),('558b6b92c31358754d3aa3cd','sails vs meteorsails','<div class=\"markdown-text\"><p>sails</p>\n<ul>\n<li><a href=\"http://www.sailsjs.org/#!/features\">http://www.sailsjs.org/#!/features</a></li>\n</ul>\n<h2></h2>\n<pre class=\"prettyprint\"><code>npm install -g sails\n</code></pre><p></p>\n<h2></h2>\n<pre class=\"prettyprint\"><code> sails --help\n\n  Usage: sails [command]\n\n  Commands:\n\n    version               \n    lift [options]        \n    new [options] [path_to_new_app]\n    generate              \n    console               \n    consle                \n    consloe               \n    c                     \n    www                   \n    debug                 \n    configure             \n    help                  \n    *                     \n\n  Options:\n\n    -h, --help     output usage information\n    -v, --version  output the version number\n    --silent       \n    --verbose      \n    --silly  \n</code></pre><p>cli</p>\n<ul>\n<li>new </li>\n<li>generate </li>\n<li>lift </li>\n</ul>\n<p>3</p>\n<p>help</p>\n<pre class=\"prettyprint\"><code> sails lift --help\n\n  Usage: lift [options]\n\n  Options:\n\n    -h, --help     output usage information\n    --prod         \n    --port [port]  \n</code></pre><h2></h2>\n<pre class=\"prettyprint\"><code>sails new helloworld\ncd helloworld \nsails lift\n</code></pre><p></p>\n<pre class=\"prettyprint\"><code>  helloworld  tree -L 2    \n.\n Gruntfile.js\n README.md\n api\n  controllers\n  models\n  policies\n  responses\n  services\n app.js\n assets\n  favicon.ico\n  images\n  js\n  robots.txt\n  styles\n  templates\n config\n  blueprints.js\n  bootstrap.js\n  connections.js\n  cors.js\n  csrf.js\n  env\n  globals.js\n  http.js\n  i18n.js\n  local.js\n  locales\n  log.js\n  models.js\n  policies.js\n  routes.js\n  session.js\n  sockets.js\n  views.js\n node_modules\n  ejs -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;ejs\n  grunt -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;grunt\n  grunt-contrib-clean -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;grunt-contrib-clean\n  grunt-contrib-coffee -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;grunt-contrib-coffee\n  grunt-contrib-concat -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;grunt-contrib-concat\n  grunt-contrib-copy -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;grunt-contrib-copy\n  grunt-contrib-cssmin -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;grunt-contrib-cssmin\n  grunt-contrib-jst -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;grunt-contrib-jst\n  grunt-contrib-less -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;grunt-contrib-less\n  grunt-contrib-uglify -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;grunt-contrib-uglify\n  grunt-contrib-watch -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;grunt-contrib-watch\n  grunt-sails-linker -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;grunt-sails-linker\n  grunt-sync -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;grunt-sync\n  include-all -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;include-all\n  rc -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;rc\n  sails -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails\n  sails-disk -&gt; &#x2F;Users&#x2F;sang&#x2F;.nvm&#x2F;v0.10.38&#x2F;lib&#x2F;node_modules&#x2F;sails&#x2F;node_modules&#x2F;sails-disk\n package.json\n tasks\n  README.md\n  config\n  pipeline.js\n  register\n views\n     403.ejs\n     404.ejs\n     500.ejs\n     homepage.ejs\n     layout.ejs\n\n36 directories, 29 files\n</code></pre><h2></h2>\n<p>app.jsexpressexpressmodule</p>\n<p>api</p>\n<pre class=\"prettyprint\"><code> api\n  controllers\n  models\n  policies\n  responses\n  services\n</code></pre><p>railsappsailsapiapi2</p>\n<ul>\n<li></li>\n<li>api</li>\n</ul>\n<p></p>\n<ul>\n<li>controllersmodelsmvcmc</li>\n<li>services modelcontroller</li>\n<li>responsesresaaares.aaa()res</li>\n<li>policies config.policies.jsacl</li>\n</ul>\n<p></p>\n<h2>node_modules</h2>\n<p></p>\n<p>railsbundle install</p>\n<p>sailsnpmsails new</p>\n<h2>views</h2>\n<p>expressejs</p>\n<pre class=\"prettyprint\"><code>&#x2F;**\n * View Engine Configuration\n * (sails.config.views)\n *\n * Server-sent views are a classic and effective way to get your app up\n * and running. Views are normally served from controllers.  Below, you can\n * configure your templating language&#x2F;framework of choice and configure\n * Sails&#x27; layout support.\n *\n * For more information on views and layouts, check out:\n * http:&#x2F;&#x2F;sailsjs.org&#x2F;#!&#x2F;documentation&#x2F;concepts&#x2F;Views\n *&#x2F;\n\nmodule.exports.views = {\n  engine: &#x27;ejs&#x27;,\n  layout: &#x27;layout&#x27;,\n  partials: false\n};\n</code></pre><p></p>\n<h2>assets</h2>\n<p>asset pipelinerailsJSCSS</p>\n<p>package.json</p>\n<pre class=\"prettyprint\"><code>&quot;grunt&quot;: &quot;0.4.2&quot;,\n&quot;grunt-contrib-clean&quot;: &quot;~0.5.0&quot;,\n&quot;grunt-contrib-coffee&quot;: &quot;~0.10.1&quot;,\n&quot;grunt-contrib-concat&quot;: &quot;~0.3.0&quot;,\n&quot;grunt-contrib-copy&quot;: &quot;~0.5.0&quot;,\n&quot;grunt-contrib-cssmin&quot;: &quot;~0.9.0&quot;,\n&quot;grunt-contrib-jst&quot;: &quot;~0.6.0&quot;,\n&quot;grunt-contrib-less&quot;: &quot;0.11.1&quot;,\n&quot;grunt-contrib-uglify&quot;: &quot;~0.4.0&quot;,\n&quot;grunt-contrib-watch&quot;: &quot;~0.5.3&quot;,\n&quot;grunt-sails-linker&quot;: &quot;~0.9.5&quot;,\n&quot;grunt-sync&quot;: &quot;~0.0.4&quot;,\n</code></pre><p></p>\n<ul>\n<li>jscoffeescript</li>\n<li>cssless</li>\n<li>gruntcleanconcatcopycssmincssuglifyjswatchsynclivereload</li>\n</ul>\n<p></p>\n<p>Here are a few things that the default Grunt configuration in Sails does to help you out:</p>\n<ul>\n<li>Automatic LESS compilation</li>\n<li>Automatic JST compilation</li>\n<li>Automatic Coffeescript compilation</li>\n<li>Optional automatic asset injection, minification, and concatenation</li>\n<li>Creation of a web ready public directory</li>\n<li>File watching and syncing</li>\n<li>Optimization of assets in production</li>\n</ul>\n<p>jst<code>grunt-contrib-jst</code></p>\n<p>grunt-cli,</p>\n<pre class=\"prettyprint\"><code>npm install -g grunt-cli\n</code></pre><p>grunt</p>\n<pre class=\"prettyprint\"><code>  helloworld  grunt       \nRunning &quot;clean:dev&quot; (clean) task\nCleaning .tmp&#x2F;public...OK\n\nRunning &quot;jst:dev&quot; (jst) task\n&gt;&gt; Destination not written because compiled files were empty.\n\nRunning &quot;less:dev&quot; (less) task\nFile .tmp&#x2F;public&#x2F;styles&#x2F;importer.css created: 0 B  619 B\n\nRunning &quot;copy:dev&quot; (copy) task