ller.like()&#96;\n   *&#x2F;\n  like: function (req, res) {\n    return res.json({\n      todo: &#x27;like() is not implemented yet!&#x27;\n    });\n  }\n};\n</code></pre><p></p>\n<p></p>\n<pre class=\"prettyprint\"><code>sails generate model user name:string email:string password:string\n</code></pre><p>Waterlinedb</p>\n<p>api</p>\n<pre class=\"prettyprint\"><code>  helloworld  sails generate api sssd sdf jklsdf werjk jlksd sd \ninfo: Created a new api!\n</code></pre><p>SssdController</p>\n<p>Sssd model</p>\n<p>config.routes.js</p>\n<p>blueprintsrestful api</p>\n<p></p>\n<pre class=\"prettyprint\"><code> sails generate api dentist\n</code></pre><p></p>\n<h2>orm</h2>\n<ul>\n<li></li>\n<li>console </li>\n</ul>\n<p>ormjsAny databasenosqlrdbmsWaterline</p>\n<p></p>\n<ul>\n<li>activerecord</li>\n<li>hibernate</li>\n</ul>\n<p></p>\n<p></p>\n<h2></h2>\n<p>sailsrails</p>\n<p>jsdb</p>\n<p></p>\n<ul>\n<li>rails</li>\n<li></li>\n<li>express</li>\n</ul>\n<p></p>\n<p>node</p>\n<p><img src=\"//static.cnodejs.org/FtALxsauUkYDGdzcuA5y6BaIdUMC\" alt=\"node.png\"></p>\n</div>','54009f5ccd66f2eb37190485',0,1,28,6911,'2015-06-25 02:46:43','2019-01-09 20:53:18','2018-10-29 05:11:25','share'),('55b9e875f36f579657fc52f3','Nodejs','<div class=\"markdown-text\"><p>ABAC</p>\n<p>Githubtestbuliding-passmodulemodule</p>\n<p>NodejsHTTPwebTDDBDD</p>\n<blockquote>\n<p> Github : <a href=\"https://github.com/JerryC8080/unittest-demo\">unittest-demo</a></p>\n</blockquote>\n<h2></h2>\n<ol>\n<li></li>\n<li></li>\n<li></li>\n<li></li>\n<li></li>\n<li></li>\n<li>Web</li>\n<li></li>\n<li>Makefile</li>\n<li>Travis-cli</li>\n<li></li>\n<li></li>\n<li></li>\n</ol>\n<h2></h2>\n<p>NodejsMocha</p>\n<p>Mocha JavascriptNode.js<strong>BDD</strong><strong>TDD</strong><strong>QUnit</strong><strong>Exports</strong>BDDMocha<a href=\"http://mochajs.org/\"></a></p>\n<h4></h4>\n<h4></h4>\n<p>MochaBDD</p>\n<ul>\n<li><code>describe()</code></li>\n<li><code>it()</code></li>\n<li><code>before()</code></li>\n<li><code>after()</code></li>\n<li><code>beforeEach()</code></li>\n<li><code>afterEach()</code></li>\n</ul>\n<h4></h4>\n<p><code>npm install mocha -g</code></p>\n<h4></h4>\n<p>limit00</p>\n<pre class=\"prettyprint language- javascript\"><code>exports.limit = function (num) {\n  if (num &lt; 0) {\n    return 0;\n  }\n  return num;\n};\n</code></pre><h4></h4>\n<ul>\n<li><code>lib</code></li>\n<li><code>test</code></li>\n<li><code>index.js</code></li>\n<li><code>package.json</code></li>\n</ul>\n<h4></h4>\n<pre class=\"prettyprint language- javascript\"><code>var lib = require(&#x27;index&#x27;);\n\ndescribe(&#x27;module&#x27;, function () {\n  describe(&#x27;limit&#x27;, function () {\n    it(&#x27;limit should success&#x27;, function () {\n      lib.limit(10);\n    });\n  });\n});\n</code></pre><h4></h4>\n<p><code>mocha</code></p>\n<pre class=\"prettyprint language-\"><code>$ mocha\n\n  \n\n   1 test complete (2ms)\n</code></pre><h2></h2>\n<p>Node.js</p>\n<ul>\n<li>should.js</li>\n<li>expect.js</li>\n<li>chai</li>\n</ul>\n<h4></h4>\n<p><code>should</code></p>\n<pre class=\"prettyprint language- javascript\"><code>it(&#x27;limit should success&#x27;, function () {\n  lib.limit(10).should.be.equal(10);\n});\n</code></pre><h2></h2>\n<p><code>limit</code>100100</p>\n<p></p>\n<p></p>\n<p></p>\n<h2></h2>\n<h4></h4>\n<p>libasync</p>\n<pre class=\"prettyprint language- javascript\"><code>exports.async = function (callback) {\n  setTimeout(function () {\n    callback(10);\n  }, 10);\n};	\n</code></pre><p></p>\n<pre class=\"prettyprint language- javascript\"><code>describe(&#x27;async&#x27;, function () {\n  it(&#x27;async&#x27;, function (done) {\n    lib.async(function (result) {\n      done();\n    });\n  });\n});\n</code></pre><h4>Promise</h4>\n<p>shouldPromise:</p>\n<ul>\n<li><code>finally</code> | <code>eventually</code></li>\n<li><code>fulfilled</code></li>\n<li><code>fulfilledWith</code></li>\n<li><code>rejected</code></li>\n<li><code>rejectedWith</code></li>\n<li><code>then</code></li>\n</ul>\n<p></p>\n<pre class=\"prettyprint language- javascript\"><code>describe(&#x27;should&#x27;, function () {\n  describe(&#x27;#Promise&#x27;, function () {\n    it(&#x27;should.reject&#x27;, function () {\n      (new Promise(function (resolve, reject) {\n        reject(new Error(&#x27;wrong&#x27;));\n      })).should.be.rejectedWith(&#x27;wrong&#x27;);\n    });\n\n    it(&#x27;should.fulfilled&#x27;, function () {\n      (new Promise(function (resolve, reject) {\n        resolve({username: &#x27;jc&#x27;, age: 18, gender: &#x27;male&#x27;})\n      })).should.be.fulfilled().then(function (it) {\n          it.should.have.property(&#x27;username&#x27;, &#x27;jc&#x27;);\n        })\n    });\n  });\n});\n</code></pre><h4></h4>\n<p>Mocha2s2stimeout</p>\n<p></p>\n<h4></h4>\n<p><code>mocha -t 10000</code></p>\n<h4>API</h4>\n<pre class=\"prettyprint language- javascript\"><code>describe(&#x27;async&#x27;, function () {\n  this.timeout(10000);\n  it(&#x27;async&#x27;, function (done) {\n    lib.async(function (result) {\n      done();\n    });\n  });\n});\n</code></pre><p><code>async</code>10stimeout</p>\n<h2></h2>\n<p><code>getContent</code></p>\n<pre class=\"prettyprint language- javascript\"><code>exports.getContent = function (filename, callback) {\n  fs.readFile(filename, &#x27;utf-8&#x27;, callback);\n};\n</code></pre><p>(mock)</p>\n<h4>Mock</h4>\n<pre class=\"prettyprint language- javascript\"><code>describe(&quot;getContent&quot;, function () {\n  var _readFile;\n  before(function () {\n    _readFile = fs.readFile;\n    fs.readFile = function (filename, encoding, callback) {\n      process.nextTick(function () {\n        callback(new Error(&quot;mock readFile error&quot;));\n      });\n    };	\n  });\n  &#x2F;&#x2F; it();\n  after(function () {\n    &#x2F;&#x2F; case\n    fs.readFile = _readFile;\n  })\n});\n</code></pre><h4>Mock</h4>\n<p>Mock<a href=\"https://github.com/fent/node-muk\"><code>muk</code></a> </p>\n<pre class=\"prettyprint language- javascript\"><code>var fs = require(&#x27;fs&#x27;);\nvar muk = require(&#x27;muk&#x27;);\n\nbefore(function () {\n  muk(fs, &#x27;readFile&#x27;, function(path, encoding, callback) {\n    process.nextTick(function () {\n      callback(new Error(&quot;mock readFile error&quot;));\n    });\n  });\n});\n&#x2F;&#x2F; it();\nafter(function () {\n  muk.restore();\n});\n</code></pre><h2></h2>\n<p>exports</p>\n<pre class=\"prettyprint language- javascript\"><code>function _adding(num1, num2) {\n  return num1 + num2;\n}\n</code></pre><h4>rewire</h4>\n<p><a href=\"http://jhnns.github.com/rewire/\"><code>rewire</code></a></p>\n<pre class=\"prettyprint language-\"><code>it(&#x27;limit should return success&#x27;, function () {\n  var lib = rewire(&#x27;..&#x2F;lib&#x2F;index.js&#x27;);\n  var litmit = lib.__get__(&#x27;limit&#x27;);\n  litmit(10);\n});\n</code></pre><h2>Web</h2>\n<p>WebAPI<code>/user</code></p>\n<p><a href=\"https://github.com/visionmedia/supertest\"><code>supertest</code></a></p>\n<pre class=\"prettyprint language- javascript\"><code>var express = require(&quot;express&quot;);\nvar request = require(&quot;supertest&quot;);\nvar app = express();\n\n&#x2F;&#x2F; \napp.get(&#x27;&#x2F;user&#x27;, function(req, res){\n  res.send(200, { name: &#x27;jerryc&#x27; });\n});\n\ndescribe(&#x27;GET &#x2F;user&#x27;, function(){\n  it(&#x27;respond with json&#x27;, function(done){\n    request(app)\n      .get(&#x27;&#x2F;user&#x27;)\n      .set(&#x27;Accept&#x27;, &#x27;application&#x2F;json&#x27;)\n      .expect(&#x27;Content-Type&#x27;, &#x2F;json&#x2F;)\n      .expect(200)\n      .end(function (err, res) {\n        if (err){\n          done(err);\n        }\n        res.body.name.should.be.eql(&#x27;jerryc&#x27;);\n        done();\n      })\n  });\n});\n</code></pre><h2></h2>\n<p></p>\n<p><a href=\"http://en.wikipedia.org/wiki/Code_coverage\">&quot;&quot;</a>code coverage</p>\n<blockquote>\n<ul>\n<li><strong></strong>line coverage</li>\n<li><strong></strong>function coverage</li>\n<li><strong></strong>branch coverageif</li>\n<li><strong></strong>statement coverage</li>\n</ul>\n</blockquote>\n<p><a href=\"https://github.com/gotwarlost/istanbul\">Istanbul</a> JavaScript </p>\n<h4></h4>\n<p><code>$ npm install -g istanbul</code></p>\n<h4></h4>\n<p></p>\n<p><code>istanbul cover _mocha</code></p>\n<p>:</p>\n<pre class=\"prettyprint language- javascript\"><code>JerryC% istanbul cover _mocha                                                                                                                                                                \n\n\n  module\n    limit\n       limit should success\n    async\n       async\n    getContent\n       getContent\n    add\n       add\n\n  should\n    #Promise\n       should.reject\n       should fulfilled\n\n\n  6 passing (32ms)\n\n\n================== Coverage summary ======================\nStatements   : 100% ( 10&#x2F;10 )\nBranches     : 100% ( 2&#x2F;2 )\nFunctions    : 100% ( 5&#x2F;5 )\nLines        : 100% ( 10&#x2F;10 )\n==========================================================\n</code></pre><p> coverage  coverage.json coverage/lcov-report </p>\n<p><img src=\"http://xia-dev.b0.upaiyun.com/eac87dbf-4e4b-426e-80ac-7c50e1b9a1cb.jpg\" alt=\"html\"></p>\n<p><code>istanbul cover</code>  <code>_mocha</code> </p>\n<p><a href=\"https://github.com/gotwarlost/istanbul/issues/44\">mocha  _mocha </a> istanbul  istanbul </p>\n<p> mocha </p>\n<pre class=\"prettyprint language-\"><code>$ istanbul cover _mocha -- tests&#x2F;test.sqrt.js -R spec\n</code></pre><p> Mocha  istanbul <a href=\"http://www.clock.co.uk/blog/npm-module-code-coverage-in-2-simple-steps\">1</a><a href=\"http://www.vapidspace.com/coding/2014/10/29/code-coverage-metrics-with-mocha-and-istanbul/\">2</a></p>\n<h2>Makefile</h2>\n<pre class=\"prettyprint language-\"><code>TESTS = test&#x2F;*.test.js\nREPORTER = spec\nTIMEOUT = 10000\nJSCOVERAGE = .&#x2F;node_modules&#x2F;jscover&#x2F;bin&#x2F;jscover\n\ntest:\n    @NODE_ENV=test .&#x2F;node_modules&#x2F;mocha&#x2F;bin&#x2F;mocha -R $(REPORTER) -t $(TIMEOUT) $(TESTS)\n\ntest-cov: lib-cov\n    @LIB_COV=1 $(MAKE) test REPORTER=dot\n    @LIB_COV=1 $(MAKE) test REPORTER=html-cov &gt; coverage.html\n\nlib-cov:\n    @rm -rf .&#x2F;lib-cov\n    @$(JSCOVERAGE) lib lib-cov\n\n.PHONY: test test-cov lib-cov\n\nmake test\nmake test-cov\n\n</code></pre><p>jscovermocha</p>\n<h2>Travis-cli</h2>\n<ul>\n<li><a href=\"https://travis-ci.org/\">Travis-ci</a>\n<ul>\n<li>Github</li>\n<li>GithubAdminServices hook</li>\n<li>Travis</li>\n<li>pushhook<code>npm test</code></li>\n</ul>\n</li>\n</ul>\n<p>TravisRuby<code>.travis.yml</code></p>\n<pre class=\"prettyprint language- yaml\"><code>language: node_js\nnode_js:\n  - &quot;0.12&quot;\n</code></pre><p>Travis-cli</p>\n<p><img src=\"https://camo.githubusercontent.com/f479d6cf4ac300093da5a90d70565cebf8c8ed40/68747470733a2f2f7365637572652e7472617669732d63692e6f72672f4a61636b736f6e5469616e2f626167706970652e706e67\" alt=\"/\">or<img src=\"https://camo.githubusercontent.com/08478cd5a732822aec47e6e60d5f823ef0898dec/68747470733a2f2f7365637572652e7472617669732d63692e6f72672f54424544502f64617461766a732e706e67\" alt=\"/\"></p>\n<p>build-passing</p>\n<p>build-failing</p>\n<h2></h2>\n<p>, ,  , ,   . , , , , .</p>\n<p> Geotechnical, . , , .</p>\n<p><a href=\"https://github.com/yangyubo/zh-unit-testing-guidelines\"></a></p>\n<h2></h2>\n<p><a href=\"https://github.com/Marak/Faker.js\"><code>faker</code></a></p>\n<p></p>\n<p></p>\n<p>Node.js</p>\n<p><img src=\"http://xia-dev.b0.upaiyun.com/43075e5e-026f-4acb-a51f-a998cf1a6e11.jpg\" alt=\"\"></p>\n<h2></h2>\n<h4>Nodejs</h4>\n<ol>\n<li> mocha</li>\n<li>should.jsexpect.jschai</li>\n<li>istanbuljscoverblanket</li>\n<li>Mockmuk</li>\n<li>rewire</li>\n<li>Websupertest</li>\n<li>Travis-cli</li>\n</ol>\n<h2></h2>\n<ul>\n<li><a href=\"https://github.com/JacksonTian/unittesting\">https://github.com/JacksonTian/unittesting</a></li>\n<li><a href></a><a href=\"http://html5ify.com/unittesting/slides/index