7;\n    &#x27;ABC&#x27;\n    \n    &gt;&gt; &#x27;I \\u2661 JavaScript!&#x27;\n    &#x27;I  JavaScript!\n</code></pre><p> <strong>Unicode</strong> 4 <code>\\u2661</code>  <code>\\U+2661</code>  <code>U+0000</code>  <code>U+FFFF</code> </p>\n<p>  4 ?</p>\n<p> ECMAScript 6: <strong>Unicode </strong>:</p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; &#x27;\\u{41}\\u{42}\\u{43}&#x27;\n    &#x27;ABC&#x27;\n    \n    &gt;&gt; &#x27;\\u{1F4A9}&#x27;\n    &#x27;&#x27; &#x2F;&#x2F; U+1F4A9 PILE OF POO\n</code></pre><p> 6  Unicode  Unicode </p>\n<p> ECMAScript 5 :</p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; &#x27;\\uD83D\\uDCA9&#x27;\n    &#x27;&#x27; &#x2F;&#x2F; U+1F4A9 PILE OF POO\n</code></pre><p></p>\n<p><a href=\"https://mathiasbynens.be/notes/javascript-encoding#surrogate-formulae\"></a></p>\n<p><strong>Supplementary Planes<strong> UTF-16 16 32bit,4Bytes</strong>(surrogate pair)</strong></p>\n<ul>\n<li> <code>0x10000</code>, 20  <code>0..0xFFFFF</code>.</li>\n<li> 10  <code>0..0x3FF</code> <code>0xD800</code> <strong></strong></li>\n<li> 10  <code>0..0x3FF</code> <code>0xDC00</code> <strong>low surrogate</strong> <code>0xDC00..0xDFFF</code>.</li>\n</ul>\n<p>( <code>U+010000</code>  <code>U+10FFFF</code> )</p>\n<h3> JavaScript </h3>\n<p>?</p>\n<p> <code>length</code> </p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; &#x27;A&#x27;.length &#x2F;&#x2F;  U+0041  A\n    1\n    \n    &gt;&gt; &#x27;A&#x27; == &#x27;\\u0041&#x27;\n    true\n    \n    &gt;&gt; &#x27;B&#x27;.length &#x2F;&#x2F;  U+0042  B\n    1\n    \n    &gt;&gt; &#x27;B&#x27; == &#x27;\\u0042&#x27;\n    true\n</code></pre><p> <code>length</code> :</p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; &#x27;&#x27;.length &#x2F;&#x2F;  U+1D400  Math Bold  A\n    2\n    \n    &gt;&gt; &#x27;&#x27; == &#x27;\\uD835\\uDC00&#x27;\n    true\n    \n    &gt;&gt; &#x27;&#x27;.length &#x2F;&#x2F;  U+1D401  Math Bold  B\n    2\n    \n    &gt;&gt; &#x27;&#x27; == &#x27;\\uD835\\uDC01&#x27;\n    true\n    \n    &gt;&gt; &#x27;&#x27;.length &#x2F;&#x2F; U+1F4A9 PILE OF POO\n    2\n    \n    &gt;&gt; &#x27;&#x27; == &#x27;\\uD83D\\uDCA9&#x27;\n    true\n</code></pre><p>JavaScript   ECMAScript 5  Unicode </p>\n<h2></h2>\n<p>: JavaScript  ? :</p>\n<pre class=\"prettyprint language-javascript\"><code>    var regexAstralSymbols = &#x2F;[\\uD800-\\uDBFF][\\uDC00-\\uDFFF]&#x2F;g;\n    \n    function countSymbols(string) {\n    	return string\n    		&#x2F;&#x2F; Replace every surrogate pair with a BMP symbol.\n    		.replace(regexAstralSymbols, &#x27;_&#x27;)\n    		&#x2F;&#x2F; and *then* get the length.\n    		.length;\n    }\n</code></pre><p> <a href=\"https://github.com/bestiejs/punycode.js\">Punycode.js</a> JavaScript  Unicode <code>decode</code>  Unicode ;</p>\n<pre class=\"prettyprint language-javascript\"><code>    function countSymbols(string) {\n    	return punycode.ucs2.decode(string).length;\n    }\n</code></pre><p> ES6  <a href=\"https://github.com/mathiasbynens/Array.from\">Array.from</a> :</p>\n<pre class=\"prettyprint language-javacript\"><code>    function countSymbols(string) {\n    	return Array.from(string).length;\n    }\n</code></pre><p> <code>...</code> :</p>\n<pre class=\"prettyprint language-javascript\"><code>    function countSymbols(string) {\n    	return [...string].length;\n    }\n</code></pre><p>:</p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; countSymbols(&#x27;A&#x27;) &#x2F;&#x2F; U+0041  A\n    1\n    \n    &gt;&gt; countSymbols(&#x27;&#x27;) &#x2F;&#x2F;  U+1D400  Math Bold  A\n    1\n    \n    &gt;&gt; countSymbols(&#x27;&#x27;) &#x2F;&#x2F; U+1F4A9 PILE OF POO\n    1\n</code></pre><h3></h3>\n<p>:</p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; &#x27;maana&#x27; == &#x27;manana&#x27;\n    false\n</code></pre><p>JavaScript?</p>\n<p><img src=\"https://image.fundebug.com/2019-01-07-1.png\" alt></p>\n<p><a href=\"https://mothereff.in/js-escapes#1ma%C3%B1ana%20man%CC%83ana\">JavaScript</a>:</p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; &#x27;ma\\xF1ana&#x27; == &#x27;man\\u0303ana&#x27;\n    false\n    \n    &gt;&gt; &#x27;ma\\xF1ana&#x27;.length\n    6\n    \n    &gt;&gt; &#x27;man\\u0303ana&#x27;.length\n    7\n</code></pre><p> <code>U+00F1</code>  n  n (<code>U+006E</code> n  <code>U+0303</code> )</p>\n<p> 6?</p>\n<p>ECMAScript 6 :</p>\n<pre class=\"prettyprint language-javascript\"><code>    function countSymbolsPedantically(string) {\n    	&#x2F;&#x2F; Unicode Normalization, NFC form, to account for lookalikes:\n    	var normalized = string.normalize(&#x27;NFC&#x27;);\n    	&#x2F;&#x2F; Account for astral symbols &#x2F; surrogates, just like we did before:\n    	return punycode.ucs2.decode(normalized).length;\n    }\n</code></pre><p><code>String.prototype</code>  <code>normalize</code>  <a href=\"http://unicode.org/reports/tr15/\">Unicode</a> </p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; countSymbolsPedantically(&#x27;maana&#x27;) &#x2F;&#x2F; U+00F1\n    6\n    &gt;&gt; countSymbolsPedantically(&#x27;manana&#x27;) &#x2F;&#x2F; U+006E + U+0303\n    6\n</code></pre><p> ECMAScript5  <strong>String.prototype.normalize polyfill</strong></p>\n<h3></h3>\n<p> normalize normalize :</p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; &#x27;q\\u0307\\u0323&#x27;.normalize(&#x27;NFC&#x27;) &#x2F;&#x2F; &#96;q&#96;\n    &#x27;q\\u0307\\u0323&#x27;\n    \n    &gt;&gt; countSymbolsPedantically(&#x27;q\\u0307\\u0323&#x27;)\n    3 &#x2F;&#x2F; not 1\n    \n    &gt;&gt; countSymbolsPedantically(&#x27;ZALGO!&#x27;)\n    74 &#x2F;&#x2F; not 6\n</code></pre><p></p>\n<pre class=\"prettyprint language-javascript\"><code>    &#x2F;&#x2F;  \n    \n    var regexSymbolWithCombiningMarks = &#x2F;(\\P{Mark})(\\p{Mark}+)&#x2F;gu;\n    \n    function countSymbolsIgnoringCombiningMarks(string) {\n    	&#x2F;&#x2F; :\n    	var stripped = string.replace(regexSymbolWithCombiningMarks, function($0, symbol, combiningMarks) {\n    		return symbol;\n    	});\n    	\n    	return punycode.ucs2.decode(stripped).length;\n    }\n</code></pre><p>() ECMAScript3 :</p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; countSymbolsIgnoringCombiningMarks(&#x27;q\\u0307\\u0323&#x27;)\n    1\n    &gt;&gt; countSymbolsIgnoringCombiningMarks(&#x27;ZALGO!&#x27;)\n    6\n</code></pre><h2></h2>\n<p> Jamo     ( <code>U+200D</code> +  <code>U+200D</code> +  + <code>U+200D</code> + </p>\n<p>Unicode  Unicode 29   <a href=\"http://www.unicode.org/reports/tr29/#Grapheme_Cluster_Boundaries\">Unicode</a> JavaScript  <a href=\"https://github.com/tc39/proposal-intl-segmenter\">Intl.SegmenterAPIECMAScript</a></p>\n<h2>JavaScript </h2>\n<p>:JavaScript? :</p>\n<pre class=\"prettyprint language-javascript\"><code>    function reverse(string) {\n    	return string.split(&#x27;&#x27;).reverse().join(&#x27;&#x27;);\n    }\n</code></pre><p>:</p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; reverse(&#x27;abc&#x27;)\n    &#x27;cba&#x27;\n    \n    &gt;&gt; reverse(&#x27;maana&#x27;) &#x2F;&#x2F; U+00F1\n    &#x27;anaam&#x27;\n</code></pre><p></p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; reverse(&#x27;maana&#x27;) &#x2F;&#x2F; U+006E + U+0303\n    &#x27;ananam&#x27; &#x2F;&#x2F; note: the &#96;~&#96; is now applied to the &#96;a&#96; instead of the &#96;n&#96;\n    \n    &gt;&gt; reverse(&#x27;&#x27;) &#x2F;&#x2F; U+1F4A9\n    &#x27;&#x27; &#x2F;&#x2F; &#96;&#x27;\\uDCA9\\uD83D&#x27;&#96;, the surrogate pair for &#96;&#96; in the wrong order\n</code></pre><p> ES6  <code>Array.from</code> </p>\n<pre class=\"prettyprint language-javascript\"><code>    function reverse(string) {\n      return Array.from(string).reverse().join(&#x27;&#x27;);\n    }\n</code></pre><p></p>\n<p> Missy Elliot <a href=\"https://www.youtube.com/watch?v=UODX_pYpVxk&amp;t=33s\"></a>:</p>\n<blockquote>\n<p></p>\n</blockquote>\n<p></p>\n<pre class=\"prettyprint language-javascript\"><code>    &#x2F;&#x2F;  Esrever (https:&#x2F;&#x2F;mths.be&#x2F;esrever)\n    \n    &gt;&gt; esrever.reverse(&#x27;maana&#x27;) &#x2F;&#x2F; U+006E + U+0303\n    &#x27;anaam&#x27;\n    \n    &gt;&gt; esrever.reverse(&#x27;&#x27;) &#x2F;&#x2F; U+1F4A9\n    &#x27;&#x27; &#x2F;&#x2F; U+1F4A9\n</code></pre><h3> Unicode </h3>\n<p></p>\n<h4><strong></strong></h4>\n<p><code>String.fromCharCode</code>   <strong>BMP</strong>  (  <code>U+0000</code> <code>U+FFFF</code>) <strong>BMP</strong>  </p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; String.fromCharCode(0x0041) &#x2F;&#x2F; U+0041\n    &#x27;A&#x27; &#x2F;&#x2F; U+0041\n    \n    &gt;&gt; String.fromCharCode(0x1F4A9) &#x2F;&#x2F; U+1F4A9\n    &#x27;&#x27; &#x2F;&#x2F; U+F4A9, not U+1F4A9\n</code></pre><p></p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; String.fromCharCode(0xD83D, 0xDCA9)\n    &#x27;&#x27; &#x2F;&#x2F; U+1F4A9\n</code></pre><p> <a href=\"https://mths.be/punycode\">Punycode.js</a> :</p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; punycode.ucs2.encode([ 0x1F4A9 ])\n    &#x27;&#x27; &#x2F;&#x2F; U+1F4A9\n</code></pre><p>ECMAScript 6  <code>String.fromCodePoint(codePoint)</code> Unicode  <code>U+000000</code>  <code>U+10FFFF</code></p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; String.fromCodePoint(0x1F4A9)\n    &#x27;&#x27; &#x2F;&#x2F; U+1F4A9\n</code></pre><p>ECMAScript 5   <code>String.fromCodePoint() polyfill</code></p>\n<h3></h3>\n<p> <code>String.prototype.charAt(position)</code> </p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; &#x27;&#x27;.charAt(0) &#x2F;&#x2F; U+1F4A9\n    &#x27;\\uD83D&#x27; &#x2F;&#x2F; U+D83D, i.e. the first surrogate half for U+1F4A9\n</code></pre><p> ECMAScript 7  <code>String.prototype.at(position)</code><code>charAt</code></p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; &#x27;&#x27;.at(0) &#x2F;&#x2F; U+1F4A9\n    &#x27;&#x27; &#x2F;&#x2F; U+1F4A9\n</code></pre><p> ECMAScript 5  <a href=\"https://github.com/mathiasbynens/String.prototype.at\">String.prototype.at() polyfill/prollyfill</a></p>\n<h3></h3>\n<p> <code>String.prototype.charCodeAt(position)</code>  poo </p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; &#x27;&#x27;.charCodeAt(0)\n    0xD83D\n</code></pre><p>ECMAScript 6  <code>String.prototype.codePointAt(position)</code> <code>charCodeAt</code></p>\n<pre class=\"prettyprint language-javascript\"><code>    &gt;&gt; &#x27;&#x27;.codePointAt(0)\n    0x1F4A9\n</code></pre><p> ECMAScript 5  <a href=\"https://github.com/mathiasbynens/String.prototype.codePointAt\">String.prototype.codePointAt()_polyfill</a></p>\n<h3></h3>\n<p></p>\n<p> ECMAScript 5 :</p>\n<pre class=\"prettyprint language-javascript\"><code>    function getSymbols(string) {\n    	var index = 0;\n    	var length = string.length;\n    	var output = [];\n    	for (; index &lt; length - 1; ++index) {\n    		var charCode = string.charCodeAt(index);\n    		if (charCode &gt;= 0xD800 &amp;&amp; charCode &lt;= 0xDBFF) {\n    			charCode = string.charCodeAt(index + 1);\n    			if (charCode &gt;= 0xDC00 &amp;&amp; charCode &lt;= 0xDFFF) {\n    				output.push(string.slice(index, index + 2));\n    				++index;\n    				continue;\n    			}\n    		}\n    		output.push(string.charAt(index));\n    	}\n    	output.push(string.charAt(index));\n    	return output;\n    }\n    \n    var symbols = getSymbols(&#x27;&#x27;);\n    symbols.forEach(function(symbol) {\n    	console.log(symbol == &#x27;&#x27;);\n    });\n</code></pre><p> <code>var regexCodePoint = /[^\\uD800-\\uDFFF]|[\\uD800-\\uDBFF][\\uDC00-\\uDFFF]|[\\uD800-\\uDFFF]/g;</code> </p>\n<p> ECMAScript 6 <code>forof</code></p>\n<pre class=\"prettyprint language-javascript\"><code>    for (const symbol of &#x27;&#x27;) {\n    	console.log(symbol == &#x27;&#x27;);\n    }\n</code></pre><p> <code>forof</code> <