><p>  </p>\n</div>','5b95eab14cdb88f72f5a920b',0,0,0,4,'2019-01-09 01:49:06','2019-01-09 20:53:18','2019-01-09 01:49:06','dev'),('5c3553945bf06c5e7e3f2e52','','<div class=\"markdown-text\"><p></p>\n</div>','5b95eab14cdb88f72f5a920b',0,0,1,6,'2019-01-09 01:51:16','2019-01-09 20:53:18','2019-01-09 02:49:38','dev'),('5c35673e3898674067a7cec3','JavaScript ','<div class=\"markdown-text\"><p><strong></strong> Clean CodeJS</p>\n<ul>\n<li><a href=\"https://juejin.im/post/5c24b7a851882509a76875e8\">JavaScript </a></li>\n<li><a href=\"https://juejin.im/user/57df39fca0bb9f0058a3c63d\"></a></li>\n</ul>\n<p><strong><a href=\"https://www.fundebug.com/\">Fundebug</a></strong></p>\n<p><strong> f * k </strong></p>\n<p></p>\n<p><code></code><code></code><code></code></p>\n<p></p>\n<ul>\n<li></li>\n<li></li>\n<li></li>\n<li></li>\n<li>SOLID</li>\n<li></li>\n<li></li>\n<li></li>\n<li></li>\n<li></li>\n</ul>\n<h3></h3>\n<h4></h4>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code> const yyyymmdstr = moment().format(&#x27;YYYY&#x2F;MM&#x2F;DD&#x27;);\n</code></pre><p><strong>Good:</strong></p>\n<pre class=\"prettyprint language-js\"><code> const currentDate = moment().format(&#x27;YYYY&#x2F;MM&#x2F;DD&#x27;);\n</code></pre><h4></h4>\n<p> <a href=\"https://unbug.github.io/codelf/\">codelf</a> </p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>getUserInfo();\ngetClientData();\ngetCustomerRecord();\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>getUser()\n</code></pre><h4></h4>\n<p> <a href=\"https://github.com/danielstjules/buddy.js\">buddy.js</a>  <a href=\"https://github.com/eslint/eslint/blob/660e0918933e6e7fede26bc675a0763a6b357c94/docs/rules/no-magic-numbers.md\">ESLint</a> </p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>&#x2F;&#x2F;  86400000 ?\nsetTimeout(blastOff, 86400000);\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>const MILLISECOND_IN_A_DAY = 86400000;\n\nsetTimeout(blastOff, MILLISECOND_IN_A_DAY);\n</code></pre><h4></h4>\n<p></p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>const ADDRESS = &#x27;One Infinite Loop, Cupertino 95014&#x27;;\nconst CITY_ZIP_CODE_REGEX = &#x2F;^[^,\\\\]+[,\\\\\\s]+(.+?)\\s*(\\d{5})?$&#x2F;;\nsaveCityZipCode(ADDRESS.match(CITY_ZIP_CODE_REGEX)[1], address.match(CITY_ZIP_CODE_REGEX)[2]);\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>const ADDRESS = &#x27;One Infinite Loop, Cupertino 95014&#x27;;\nconst CITY_ZIP_CODE_REGEX = &#x2F;^[^,\\\\]+[,\\\\\\s]+(.+?)\\s*(\\d{5})?$&#x2F;;\nconst [, city, zipCode] = ADDRESS.match(CITY_ZIP_CODE_REGEX) || [];\nsaveCityZipCode(city, zipCode);\n</code></pre><h4></h4>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>const locations = [&#x27;Austin&#x27;, &#x27;New York&#x27;, &#x27;San Francisco&#x27;];\nlocations.forEach((l) =&gt; {\n  doStuff();\n  doSomeOtherStuff();\n  &#x2F;&#x2F; ...\n  &#x2F;&#x2F; ...\n  &#x2F;&#x2F; ...\n  &#x2F;&#x2F;  &#x27;l&#x27; \n  dispatch(l);\n});\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>const locations = [&#x27;Austin&#x27;, &#x27;New York&#x27;, &#x27;San Francisco&#x27;];\nlocations.forEach((location) =&gt; {\n  doStuff();\n  doSomeOtherStuff();\n  &#x2F;&#x2F; ...\n  &#x2F;&#x2F; ...\n  &#x2F;&#x2F; ...\n  dispatch(location);\n});\n</code></pre><h4></h4>\n<p> car carColor</p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>const car = {\n  carMake: &#x27;Honda&#x27;,\n  carModel: &#x27;Accord&#x27;,\n  carColor: &#x27;Blue&#x27;\n};\n\nfunction paintCar(car) {\n  car.carColor = &#x27;Red&#x27;;\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>const car = {\n  make: &#x27;Honda&#x27;,\n  model: &#x27;Accord&#x27;,\n  color: &#x27;Blue&#x27;\n};\n\nfunction paintCar(car) {\n  car.color = &#x27;Red&#x27;;\n}\n</code></pre><h4></h4>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>function createMicrobrewery(name) {\n  const breweryName = name || &#x27;Hipster Brew Co.&#x27;;\n  &#x2F;&#x2F; ...\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function createMicrobrewery(name = &#x27;Hipster Brew Co.&#x27;) {\n  &#x2F;&#x2F; ...\n}\n</code></pre><h3></h3>\n<h4></h4>\n<p> <code>ES2015/ES6</code> </p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>function createMenu(title, body, buttonText, cancellable) {\n  &#x2F;&#x2F; ...\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function createMenu({ title, body, buttonText, cancellable }) {\n  &#x2F;&#x2F; ...\n}\n\ncreateMenu({\n  title: &#x27;Foo&#x27;,\n  body: &#x27;Bar&#x27;,\n  buttonText: &#x27;Baz&#x27;,\n  cancellable: true\n});\n</code></pre><h4></h4>\n<p></p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>function emailClients(clients) {\n  clients.forEach((client) =&gt; {\n    const clientRecord = database.lookup(client);\n    if (clientRecord.isActive()) {\n      email(client);\n    }\n  });\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function emailActiveClients(clients) {\n  clients\n    .filter(isActiveClient)\n    .forEach(email);\n}\nfunction isActiveClient() {\n  const clientRecord = database.lookup(client);    \n  return clientRecord.isActive();\n}\n</code></pre><h4></h4>\n<p></p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>function addToDate(date, month) {\n  &#x2F;&#x2F; ...\n}\n\nconst date = new Date();\n\n&#x2F;&#x2F; \naddToDate(date, 1);\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function addMonthToDate(month, date) {\n  &#x2F;&#x2F; ...\n}\n\nconst date = new Date();\naddMonthToDate(1, date);\n</code></pre><h4></h4>\n<p></p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>function parseBetterJSAlternative(code) {\n  const REGEXES = [\n    &#x2F;&#x2F; ...\n  ];\n\n  const statements = code.split(&#x27; &#x27;);\n  const tokens = [];\n  REGEXES.forEach((REGEX) =&gt; {\n    statements.forEach((statement) =&gt; {\n      &#x2F;&#x2F; ...\n    });\n  });\n\n  const ast = [];\n  tokens.forEach((token) =&gt; {\n    &#x2F;&#x2F; lex...\n  });\n\n  ast.forEach((node) =&gt; {\n    &#x2F;&#x2F; parse...\n  });\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function parseBetterJSAlternative(code) {\n  const tokens = tokenize(code);\n  const ast = lexer(tokens);\n  ast.forEach((node) =&gt; {\n    &#x2F;&#x2F; parse...\n  });\n}\n\nfunction tokenize(code) {\n  const REGEXES = [\n    &#x2F;&#x2F; ...\n  ];\n\n  const statements = code.split(&#x27; &#x27;);\n  const tokens = [];\n  REGEXES.forEach((REGEX) =&gt; {\n    statements.forEach((statement) =&gt; {\n      tokens.push( &#x2F;* ... *&#x2F; );\n    });\n  });\n\n  return tokens;\n}\n\nfunction lexer(tokens) {\n  const ast = [];\n  tokens.forEach((token) =&gt; {\n    ast.push( &#x2F;* ... *&#x2F; );\n  });\n\n  return ast;\n}\n</code></pre><h4></h4>\n<p></p>\n<p> <code>SOLID</code> <code>SOLID</code> </p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>function showDeveloperList(developers) {\n  developers.forEach((developer) =&gt; {\n    const expectedSalary = developer.calculateExpectedSalary();\n    const experience = developer.getExperience();\n    const githubLink = developer.getGithubLink();\n    const data = {\n      expectedSalary,\n      experience,\n      githubLink\n    };\n\n    render(data);\n  });\n}\n\nfunction showManagerList(managers) {\n  managers.forEach((manager) =&gt; {\n    const expectedSalary = manager.calculateExpectedSalary();\n    const experience = manager.getExperience();\n    const portfolio = manager.getMBAProjects();\n    const data = {\n      expectedSalary,\n      experience,\n      portfolio\n    };\n\n    render(data);\n  });\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function showEmployeeList(employees) {\n  employees.forEach(employee =&gt; {\n    const expectedSalary = employee.calculateExpectedSalary();\n    const experience = employee.getExperience();\n    const data = {\n      expectedSalary,\n      experience,\n    };\n    \n    switch(employee.type) {\n      case &#x27;develop&#x27;:\n        data.githubLink = employee.getGithubLink();\n        break\n      case &#x27;manager&#x27;:\n        data.portfolio = employee.getMBAProjects();\n        break\n    }\n    render(data);\n  })\n}\n</code></pre><h4></h4>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>const menuConfig = {\n  title: null,\n  body: &#x27;Bar&#x27;,\n  buttonText: null,\n  cancellable: true\n};\n\nfunction createMenu(config) {\n  config.title = config.title || &#x27;Foo&#x27;;\n  config.body = config.body || &#x27;Bar&#x27;;\n  config.buttonText = config.buttonText || &#x27;Baz&#x27;;\n  config.cancellable = config.cancellable !== undefined ? config.cancellable : true;\n}\n\ncreateMenu(menuConfig);\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>const menuConfig = {\n  title: &#x27;Order&#x27;,\n  &#x2F;&#x2F; &#x27;body&#x27; key \n  buttonText: &#x27;Send&#x27;,\n  cancellable: true\n};\n\nfunction createMenu(config) {\n  config = Object.assign({\n    title: &#x27;Foo&#x27;,\n    body: &#x27;Bar&#x27;,\n    buttonText: &#x27;Baz&#x27;,\n    cancellable: true\n  }, config);\n\n  &#x2F;&#x2F; config : {title: &quot;Order&quot;, body: &quot;Bar&quot;, buttonText: &quot;Send&quot;, cancellable: true}\n  &#x2F;&#x2F; ...\n}\n\ncreateMenu(menuConfig);\n</code></pre><h4> flag </h4>\n<p> flag  true  false</p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>function createFile(name, temp) {\n  if (temp) {\n    fs.create(&#96;.&#x2F;temp&#x2F;${name}&#96;);\n  } else {\n    fs.create(name);\n  }\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function createFile(name) {\n  fs.create(name);\n}\nfunction createFileTemplate(name) {\n  createFile(&#96;.&#x2F;temp&#x2F;${name}&#96;)\n}\n</code></pre><h4></h4>\n<p> IO \n IO //\n</p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>&#x2F;&#x2F; \n&#x2F;&#x2F; \nvar name = &#x27;Ryan McDermott&#x27;;\n\nfunction splitIntoFirstAndLastName() {\n  name = name.split(&#x27; &#x27;);\n}\n\nsplitIntoFirstAndLastName();\n\nconsole.log(name); &#x2F;&#x2F; [&#x27;Ryan&#x27;, &#x27;McDermott&#x27;];\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>var name = &#x27;Ryan McDermott&#x27;;\nvar newName = splitIntoFirstAndLastName(name)\n\nfunction splitIntoFirstAndLastName(name) {\n  return name.split(&#x27; &#x27;);\n}\n\nconsole.log(name); &#x2F;&#x2F; &#x27;Ryan McDermott&#x27;;\nconsole.log(newName); &#x2F;&#x2F; [&#x27;Ryan&#x27;, &#x27;McDermott&#x27;];\n</code></pre><h4></h4>\n<p> JavaScript \n <code>addItemToCart()</code>  <code></code> <code>purchase()</code>  <code></code> </p>\n<p></p>\n<p> <code>purchase()</code>  <code>purchase()</code>  <code></code> </p>\n<p> <code></code> </p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>const addItemToCart = (cart, item) =&gt; {\n  cart.push({ item, date: Date.now() });\n};\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>const addItemToCart = (cart, item) =&gt; {\n  return [...cart, {item, date: Date.now()}]\n};\n</code></pre><h4></h4>\n<p> JavaScript  bug <code>Array.prototype</code>  <code>diff</code>  <code>diff</code>  ES2015/ES6  <code>Array</code> \n<strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>Array.prototype.diff = function diff(comparisonArray) {\n  const hash = new Set(comparisonArray);\n  return this.filter(elem =&gt; !hash.has(elem));\n};\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>class SuperArray extends Array {\n  diff(comparisonArray) {\n    const hash = new Set(comparisonArray);\n    return this.filter(elem =&gt; !hash.has(elem));        \n  }\n}\n</code></pre><h4></h4>\n<p></p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>const programmerOutput = [\n  {\n    name: &#x27;Uncle Bobby&#x27;,\n    linesOfCode: 500\n  }, {\n    name: &#x27;Suzie Q&#x27;,\n    linesOfCode: 1500\n  }, {\n    name: &#x27;Jimmy Gosling&#x27;,\n    linesOfCode: 150\n  }, {\n    name: &#x27;Gracie Hopper&#x27;,\n    linesOfCode: 1000\n  }\n];\n\nlet totalOutput = 0;\n\nfor (let i = 0; i &lt; programmerOutput.length; i++) {\n  totalOutput += programmerOutput[i].linesOfCode;\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>const programmerOutput = [\n  {\n    name: &#x27;Uncle Bobby&#x27;,\n    linesOfCode: 500\n  }, {\n    name: &#x27;Suzie Q&#x27;,\n    linesOfCode: 1500\n  }, {\n    name: &#x27;Jimmy Gosling&#x27;,\n    linesOfCode: 150\n  }, {\n    name: &#x27;Gracie Hopper&#x27;,\n    linesOfCode: 1000\n  }\n];\nlet totalOutput = programmerOutput\n  .map(output =&gt; output.linesOfCode)\n  .reduce((totalLines, lines) =&gt; totalLines + lines, 0)\n</code></pre><h4></h4>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>if (fsm.state === &#x27;fetching&#x27; &amp;&amp; isEmpty(listNode)) {\n  &#x2F;&#x2F; ...\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function shouldShowSpinner(fsm, listNode) {\n  return fsm.state === &#x27;fetching&#x27; &amp;&amp; isEmpty(listNode);\n}\n\nif (shouldShowSpinner(fsmInstance, listNodeInstance)) {\n  &#x2F;&#x2F; ...\n}\n</code></pre><h4></h4>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>function isDOMNodeNotPresent(node) {\n  &#x2F;&#x2F; ...\n}\n\nif (!isDOMNodeNotPresent(node)) {\n  &#x2F;&#x2F; ...\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function isDOMNodePresent(node) {\n  &#x2F;&#x2F; ...\n}\n\nif (isDOMNodePresent(node)) {\n  &#x2F;&#x2F; ...\n}\n</code></pre><h4></h4>\n<p>Q\nA\nQ\nA</p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>class Airplane {\n  &#x2F;&#x2F; ...\n  \n  &#x2F;&#x2F; \n  getCruisingAltitude() {\n    switch (this.type) {\n      case &#x27;777&#x27;:\n        return this.getMaxAltitude() - this.getPassengerCount();\n      case &#x27;Air Force One&#x27;:\n        return this.getMaxAltitude();\n      case &#x27;Cessna&#x27;:\n        return this.getMaxAltitude() - this.getFuelExpenditure();\n    }\n  }\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>class Airplane {\n  &#x2F;&#x2F; ...\n}\n&#x2F;&#x2F; 777\nclass Boeing777 extends Airplane {\n  &#x2F;&#x2F; ...\n  getCruisingAltitude() {\n    return this.getMaxAltitude() - this.getPassengerCount();\n  }\n}\n&#x2F;&#x2F; \nclass AirForceOne extends Airplane {\n  &#x2F;&#x2F; ...\n  getCruisingAltitude() {\n    return this.getMaxAltitude();\n  }\n}\n&#x2F;&#x2F; \nclass Cessna extends Airplane {\n  &#x2F;&#x2F; ...\n  getCruisingAltitude() {\n    return this.getMaxAltitude() - this.getFuelExpenditure();\n  }\n}\n</code></pre><h4></h4>\n<p>JavaScript  API </p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>function travelToTexas(vehicle) {\n  if (vehicle instanceof Bicycle) {\n    vehicle.pedal(this.currentLocation, new Location(&#x27;texas&#x27;));\n  } else if (vehicle instanceof Car) {\n    vehicle.drive(this.currentLocation, new Location(&#x27;texas&#x27;));\n  }\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function travelToTexas(vehicle) {\n  vehicle.move(this.currentLocation, new Location(&#x27;texas&#x27;));\n}\n</code></pre><h4></h4>\n<p> TypeScript</p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>function combine(val1, val2) {\n  if (typeof val1 === &#x27;number&#x27; &amp;&amp; typeof val2 === &#x27;number&#x27; ||\n      typeof val1 === &#x27;string&#x27; &amp;&amp; typeof val2 === &#x27;string&#x27;) {\n    return val1 + val2;\n  }\n\n  throw new Error(&#x27;Must be of type String or Number&#x27;);\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function combine(val1, val2) {\n  return val1 + val2;\n}\n</code></pre><h4></h4>\n<p><a href=\"https://github.com/petkaantonov/bluebird/wiki/Optimization-killers\"></a></p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>&#x2F;&#x2F;  &#96;list.length&#96; \n&#x2F;&#x2F; \nfor (let i = 0, len = list.length; i &lt; len; i++) {\n  &#x2F;&#x2F; ...\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>for (let i = 0; i &lt; list.length; i++) {\n  &#x2F;&#x2F; ...\n}\n</code></pre><h4></h4>\n<p></p>\n<p></p>\n<p></p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>function oldRequestModule(url) {\n  &#x2F;&#x2F; ...\n}\n\nfunction newRequestModule(url) {\n  &#x2F;&#x2F; ...\n}\n\nconst req = newRequestModule;\ninventoryTracker(&#x27;apples&#x27;, req, &#x27;www.inventory-awesome.io&#x27;);\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function newRequestModule(url) {\n  &#x2F;&#x2F; ...\n}\n\nconst req = newRequestModule;\ninventoryTracker(&#x27;apples&#x27;, req, &#x27;www.inventory-awesome.io&#x27;);\n</code></pre><h3></h3>\n<h4> getset </h4>\n<p> <code>set</code> </p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>function makeBankAccount() {\n  &#x2F;&#x2F; ...\n\n  return {\n    balance: 0,\n    &#x2F;&#x2F; ...\n  };\n}\n\nconst account = makeBankAccount();\naccount.balance = 100;\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function makeBankAccount() {\n  &#x2F;&#x2F; \n  let balance = 0;\n\n  function getBalance() {\n    return balance;\n  }\n  \n  function setBalance(amount) {\n    &#x2F;&#x2F; ...  balance  amount \n    balance = amount;\n  }\n\n  return {\n    &#x2F;&#x2F; ...\n    getBalance,\n    setBalance,\n  };\n}\n\nconst account = makeBankAccount();\naccount.setBalance(100);\n</code></pre><h4></h4>\n<p></p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>const Employee = function(name) {\n  this.name = name;\n};\n\nEmployee.prototype.getName = function getName() {\n  return this.name;\n};\n\nconst employee = new Employee(&#x27;John Doe&#x27;);\nconsole.log(&#96;Employee name: ${employee.getName()}&#96;); &#x2F;&#x2F; Employee name: John Doe\ndelete employee.name;\nconsole.log(&#96;Employee name: ${employee.getName()}&#96;); &#x2F;&#x2F; Employee name: undefined\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>function makeEmployee(name) {\n  return {\n    getName() {\n      return name;\n    },\n  };\n}\n\nconst employee = makeEmployee(&#x27;John Doe&#x27;);\nconsole.log(&#96;Employee name: ${employee.getName()}&#96;); &#x2F;&#x2F; Employee name: John Doe\ndelete employee.name;\nconsole.log(&#96;Employee name: ${employee.getName()}&#96;); &#x2F;&#x2F; Employee name: John Doe\n</code></pre><h3></h3>\n<h4> class</h4>\n<p> ES2015/ES6 </p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>&#x2F;&#x2F; \nconst Animal = function(age) {\n  if (!(this instanceof Animal)) {\n    throw new Error(&#x27;Instantiate Animal with &#96;new&#96;&#x27;);\n  }\n\n  this.age = age;\n};\n\nAnimal.prototype.move = function move() {};\n\n&#x2F;&#x2F; \nconst Mammal = function(age, furColor) {\n  if (!(this instanceof Mammal)) {\n    throw new Error(&#x27;Instantiate Mammal with &#96;new&#96;&#x27;);\n  }\n\n  Animal.call(this, age);\n  this.furColor = furColor;\n};\n\nMammal.prototype = Object.create(Animal.prototype);\nMammal.prototype.constructor = Mammal;\nMammal.prototype.liveBirth = function liveBirth() {};\n\n&#x2F;&#x2F; \nconst Human = function(age, furColor, languageSpoken) {\n  if (!(this instanceof Human)) {\n    throw new Error(&#x27;Instantiate Human with &#96;new&#96;&#x27;);\n  }\n\n  Mammal.call(this, age, furColor);\n  this.languageSpoken = languageSpoken;\n};\n\nHuman.prototype = Object.create(Mammal.prototype);\nHuman.prototype.constructor = Human;\nHuman.prototype.speak = function speak() {};\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>&#x2F;&#x2F; \nclass Animal {\n  constructor(age) {\n    this.age = age\n  };\n  move() {};\n}\n\n&#x2F;&#x2F; \nclass Mammal extends Animal{\n  constructor(age, furColor) {\n    super(age);\n    this.furColor = furColor;\n  };\n  liveBirth() {};\n}\n\n&#x2F;&#x2F; \nclass Human extends Mammal{\n  constructor(age, furColor, languageSpoken) {\n    super(age, furColor);\n    this.languageSpoken = languageSpoken;\n  };\n  speak() {};\n}\n</code></pre><h4></h4>\n<p> jQueryLodash  this </p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>class Car {\n  constructor(make, model, color) {\n    this.make = make;\n    this.model = model;\n    this.color = color;\n  }\n\n  setMake(make) {\n    this.make = make;\n  }\n\n  setModel(model) {\n    this.model = model;\n  }\n\n  setColor(color) {\n    this.color = color;\n  }\n\n  save() {\n    console.log(this.make, this.model, this.color);\n  }\n}\n\nconst car = new Car(&#x27;Ford&#x27;,&#x27;F-150&#x27;,&#x27;red&#x27;);\ncar.setColor(&#x27;pink&#x27;);\ncar.save();\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>class Car {\n  constructor(make, model, color) {\n    this.make = make;\n    this.model = model;\n    this.color = color;\n  }\n\n  setMake(make) {\n    this.make = make;\n    return this;\n  }\n\n  setModel(model) {\n    this.model = model;\n    return this;\n  }\n\n  setColor(color) {\n    this.color = color;\n    return this;\n  }\n\n  save() {\n    console.log(this.make, this.model, this.color);\n    return this;\n  }\n}\n\nconst car = new Car(&#x27;Ford&#x27;,&#x27;F-150&#x27;,&#x27;red&#x27;)\n  .setColor(&#x27;pink&#x27;);\n  .save();\n</code></pre><h4></h4>\n<p> Human-&gt;Animal vs. User-&gt;UserDetails</p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>class Employee {\n  constructor(name, email) {\n    this.name = name;\n    this.email = email;\n  }\n\n  &#x2F;&#x2F; ...\n}\n\n&#x2F;&#x2F; TaxData Employee\nclass EmployeeTaxData extends Employee {\n  constructor(ssn, salary) {\n    super();\n    this.ssn = ssn;\n    this.salary = salary;\n  }\n\n  &#x2F;&#x2F; ...\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>class EmployeeTaxData {\n  constructor(ssn, salary) {\n    this.ssn = ssn;\n    this.salary = salary;\n  }\n\n  &#x2F;&#x2F; ...\n}\n\nclass Employee {\n  constructor(name, email) {\n    this.name = name;\n    this.email = email;\n  }\n\n  setTaxData(ssn, salary) {\n    this.taxData = new EmployeeTaxData(ssn, salary);\n  }\n  &#x2F;&#x2F; ...\n}\n</code></pre><h3>SOLID</h3>\n<p>SOLID  <code></code><code></code><code></code><code></code><code></code></p>\n<h4></h4>\n<p></p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>class UserSettings {\n  constructor(user) {\n    this.user = user;\n  }\n\n  changeSettings(settings) {\n    if (this.verifyCredentials()) {\n      &#x2F;&#x2F; ...\n    }\n  }\n\n  verifyCredentials() {\n    &#x2F;&#x2F; ...\n  }\n}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>class UserAuth {\n  constructor(user) {\n    this.user