n-leap year&#x27;, () =&gt; {\n    const date = new MakeMomentJSGreatAgain(&#x27;2&#x2F;1&#x2F;2015&#x27;);\n    date.addDays(28);\n    assert.equal(&#x27;03&#x2F;01&#x2F;2015&#x27;, date);\n  });\n});\n</code></pre><h3></h3>\n<h4></h4>\n<p> Promises </p>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>import { get } from &#x27;request&#x27;;\nimport { writeFile } from &#x27;fs&#x27;;\n\nget(&#x27;https:&#x2F;&#x2F;en.wikipedia.org&#x2F;wiki&#x2F;Robert_Cecil_Martin&#x27;, (requestErr, response) =&gt; {\n  if (requestErr) {\n    console.error(requestErr);\n  } else {\n    writeFile(&#x27;article.html&#x27;, response.body, (writeErr) =&gt; {\n      if (writeErr) {\n        console.error(writeErr);\n      } else {\n        console.log(&#x27;File written&#x27;);\n      }\n    });\n  }\n});\n</code></pre><p>Good</p>\n<pre class=\"prettyprint language-js\"><code>get(&#x27;https:&#x2F;&#x2F;en.wikipedia.org&#x2F;wiki&#x2F;Robert_Cecil_Martin&#x27;)\n  .then((response) =&gt; {\n    return writeFile(&#x27;article.html&#x27;, response);\n  })\n  .then(() =&gt; {\n    console.log(&#x27;File written&#x27;);\n  })\n  .catch((err) =&gt; {\n    console.error(err);\n  });\n</code></pre><h4>Async/Await  Promises </h4>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>import { get } from &#x27;request-promise&#x27;;\nimport { writeFile } from &#x27;fs-promise&#x27;;\n\nget(&#x27;https:&#x2F;&#x2F;en.wikipedia.org&#x2F;wiki&#x2F;Robert_Cecil_Martin&#x27;)\n  .then((response) =&gt; {\n    return writeFile(&#x27;article.html&#x27;, response);\n  })\n  .then(() =&gt; {\n    console.log(&#x27;File written&#x27;);\n  })\n  .catch((err) =&gt; {\n    console.error(err);\n  });\n</code></pre><p>Good</p>\n<pre class=\"prettyprint language-js\"><code>import { get } from &#x27;request-promise&#x27;;\nimport { writeFile } from &#x27;fs-promise&#x27;;\n\nasync function getCleanCodeArticle() {\n  try {\n    const response = await get(&#x27;https:&#x2F;&#x2F;en.wikipedia.org&#x2F;wiki&#x2F;Robert_Cecil_Martin&#x27;);\n    await writeFile(&#x27;article.html&#x27;, response);\n    console.log(&#x27;File written&#x27;);\n  } catch(err) {\n    console.error(err);\n  }\n}\n</code></pre><h3></h3>\n<h4></h4>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>try {\n  functionThatMightThrow();\n} catch (error) {\n  console.log(error);\n}\n</code></pre><p>Good</p>\n<pre class=\"prettyprint language-js\"><code>try {\n  functionThatMightThrow();\n} catch (error) {\n  &#x2F;&#x2F;  console.log \n  console.error(error);\n  &#x2F;&#x2F; \n  notifyUserOfError(error);\n  &#x2F;&#x2F; \n  reportErrorToService(error);\n  &#x2F;&#x2F; \n}\n</code></pre><h4> Promises </h4>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>getdata()\n  .then((data) =&gt; {\n    functionThatMightThrow(data);\n  })\n  .catch((error) =&gt; {\n    console.log(error);\n  });\n</code></pre><p>Good</p>\n<pre class=\"prettyprint language-js\"><code>getdata()\n  .then((data) =&gt; {\n    functionThatMightThrow(data);\n  })\n  .catch((error) =&gt; {\n    &#x2F;&#x2F;  console.log \n    console.error(error);\n    &#x2F;&#x2F; \n    notifyUserOfError(error);\n    &#x2F;&#x2F; \n    reportErrorToService(error);\n    &#x2F;&#x2F; \n  });\n</code></pre><h3></h3>\n<p></p>\n<h4></h4>\n<p><strong>Bad:</strong></p>\n<pre class=\"prettyprint language-js\"><code>const DAYS_IN_WEEK = 7;\nconst daysInMonth = 30;\n\nconst songs = [&#x27;Back In Black&#x27;, &#x27;Stairway to Heaven&#x27;, &#x27;Hey Jude&#x27;];\nconst Artists = [&#x27;ACDC&#x27;, &#x27;Led Zeppelin&#x27;, &#x27;The Beatles&#x27;];\n\nfunction eraseDatabase() {}\nfunction restore_database() {}\n\nclass animal {}\nclass Alpaca {}\n</code></pre><p><strong>Good</strong></p>\n<pre class=\"prettyprint language-js\"><code>const DAYS_IN_WEEK = 7;\nconst DAYS_IN_MONTH = 30;\n\nconst SONGS = [&#x27;Back In Black&#x27;, &#x27;Stairway to Heaven&#x27;, &#x27;Hey